import React from "react";
import "./style.css";

function Navbar(props) {
    return (
        <div className="navTop">
            <nav className="navbar navbar-dark bg-dark " id="nav1">
            <div className="navDiv">
                <div className="navbar-brand" href="/">React Portfolio</div>
                <a className="navMenu" href="#aboutMe" id="navAbout"> About</a>
                <a className="navMenu" href="#portSec" id="navPort">Portfolio</a>
                <div className="navMenu" id="navContact">Contact</div>
            </div>
        </nav>
        </div>



    );
}

export default Navbar;
